import React from "react";
import {Image, View} from "react-native";

import {styles} from './styles';
import iconPng from '../../assets/icon.png';

console.log(iconPng);

export function Singin() {
    return (
        <View style={styles.container}>
            <View style={styles.logo}>
                <Image
                    style={styles.img}
                    source={iconPng}
                />
            </View>
        </View>
    )
}
